webpackJsonp([0xb03c5a6e878e],{7626:function(e,t){e.exports={data:{post:{html:'<p>My <a href="http://www.papascott.de/archives/2006/06/02/mb-13183-cto-white/" title="PapaScott &raquo; Blog Archive &raquo; MB 13/1.83 CTO WHITE">MacBook</a>, ordered on 31 May from the German Apple Store, hasn\'t been delivered yet. But thanks to the <a href="http://www.apecode.com/appletrack/">Apple Tracking</a> site at apecode, where one can track European Apple Store orders, I know my MacBook is out of the factory and waiting for a flight out of Shanghai. Expected delivery date: 29 June.</p>\n<p>Four weeks from order to delivery? Next time I think I\'ll try a local dealer.</p>',fields:{title:"MacBook Shanghaied",date:"21 Jun 2006",url:"https://papascott.de/2006-06-21-macbook-shanghaied/"}}},pathContext:{slug:"/2006-06-21-macbook-shanghaied/",prev:{fields:{title:"VIP for a day at the World Cup",date:"20 Jun 2006",slug:"/2006-06-20-vip-for-a-day-at-the-world-cup/"}},next:{fields:{title:"Wave If You See Us",date:"22 Jun 2006",slug:"/2006-06-22-wave-if-you-see-us/"}}}}}});
